import React from "react";
import './HomePage.css' ;
import { Link } from "react-router-dom";

const HomePage =()=>{

    return(
        <div className="tet">
            <div className="nav">
                <nav className="navbar-1">
                    <ul>
                        <div className="flex-divs">
                            <li id="women-section-tab">
                                <Link id="women-section" to="#">WOMEN</Link>
                            </li>
                        </div>
                    </ul>
                </nav>
            </div>
         </div>
    )
}

export default HomePage;
